import React, { Component } from 'react'

class InfoBar extends Component {
    renderInfo(){
        if (this.props.node){
            var peers = this.props.node.Details._peer
            return peers.map((id) => {
                return <tr><td>{id}</td></tr>
            })
        }
        return (
           <p/>
        )
    }

    render() {
        return (
            <div className="InfoBar">
                <h3 className="title">Details : </h3>
                {this.renderInfo()}
            </div> 
        )
    }
}

export default InfoBar
